import './App.css';

const App = () => {
  return (
    <>
      <Header />
      <Information />
    </>
  );
}

const Header = () => {
  return (
    <div>
      <a href='#s'>News</a>
      <a href='#s'>Menu</a>
      <a href='#s'>Messages</a>
      <a href='#s'>Settings</a>
    </div>);
};

const Information = () => {
  return (
    <div>
      <p>Йоу страница нафиг</p>
    </div>
  );
};

export default App;
